const Users = () => {
	let users = useSelector(state => state.usersPage.users)

	let users_items = users.map(
		user => <ItemUser key={ user.id } name={ user.name } description={ user.description }/>
	)

	console.log(users)

	return (
		<div className='users'>
			<PageTitle title='Users'/>
			<div className="users__body">
				<ItemUser/>
			</div>
		</div>
	)
}

export default Users;
